import React from 'react';
import Item from './components/Item';
import Layout from './components/Layout';
import Tap from './components/Tap';

import { Main as MainLayout } from 'layouts';

const Cs = () => {
  return (
    <MainLayout>
      <Layout>
        <Tap>
          <Item />
        </Tap>
      </Layout>
    </MainLayout>
  );
};

export default Cs;
